import Api from "./Api";


function ProductCardList(items) {
    return (
        <div>
            <img src={items.images} alt={items.tags} />
            <div>
                <h3>{items.name}</h3>
                <p>{items.price}</p>
                <p></p>
            </div>
        </div>
    );
}

function ProductCard({ items }) {
    return (
        <ui>{items.map((items) => {
            return <li><ProductCardList items={items}/></li>
        })}</ui>
    );
}

export default ProductCard;
